import React from 'react'

function Form() {
    return (
        <div>
            <input value={email} placeholder="Email" onChange={onChangeInput} required />
            <input value={pass} placeholder="Password" onChange={onChangeInput} required />
            <input className="button" type="submit" value={this.props.loading ? "Logging..." : "Login"} disabled={this.props.loading} />

        </div>
    )
}

export default Form
